import React from 'react';
import {
  BrowserRouter as Router,
  Route,
} from 'react-router-dom';
import Home from './pages/Home';
import About from './pages/About';

function App() {
  return (
    <Router>
        <Route exact path='/' element={ <Home /> } />
        <Route exact path='/about' element={ <About /> } />
    </Router>
  );
}

export default App;
